import * as React from "react";
import Button from "@mui/material/Button";

function App() {
  return (
    <div className="App">
      <Button variant="text" color="error">
        Text
      </Button>
      <Button
        variant="contained"
        sx={{
          "&:hover": {
            backgroundColor: "pink",
          },
        }}
      >
        Contained
      </Button>
      <Button
        href="https://www.youtube.com/"
        color="secondary"
        variant="outlined"
        target="_"
      >
        GOOGLE
      </Button>
    </div>
  );
}

export default App;
